INSERT INTO `wp_posts` VALUES (1,1,'2015-06-02 16:58:34','2015-06-02 16:58:34','Welcome to <a href=\"http://vip.local/\">Vip.local</a>. This is your first post. Edit or delete it, then start blogging!','Hello world!','','publish','open','open','','hello-world','','','2015-06-02 16:58:34','2015-06-02 16:58:34','',0,'http://vip.local/?p=1',0,'post','',1),(2,1,'2015-06-02 16:58:34','2015-06-02 16:58:34','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href=\"http://vip.local/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!\r\n\r\n&nbsp;\r\n\r\n[contact-form][contact-field label=\'Name\' type=\'name\' required=\'1\'/][contact-field label=\'Email\' type=\'email\' required=\'1\'/][contact-field label=\'Website\' type=\'url\'/][contact-field label=\'Comment\' type=\'textarea\' required=\'1\'/][/contact-form]','Sample Page','','publish','open','open','','sample-page','','','2015-06-10 09:25:35','2015-06-10 14:25:35','',0,'http://vip.local/?page_id=2',0,'page','',0),(6,1,'2015-06-04 11:20:16','2015-06-04 16:20:16','English text on page','Testing Babble','','publish','open','open','','testing-babble','','','2015-06-04 12:56:25','2015-06-04 17:56:25','',0